> Se déplacer de 20m toutes les 45 secondes par précaution c’est assez jouable quand même 
> 45 secondes c’est presque le temps que j’ai du passer a pas dps sur le kill
@Tootow Mais Awk etait premier a l'aggro pourtant !

Ce soir vous ne serez que 3 démos :
@Paci => malé ombre
@Bind-ML => Malé elem
@Chicoscabana => Malé témé
Il faut que chaque malédictions soient mises sur CHAQUE trash, et les malédictions d'ombre et éléments sur chaque boss, le up est plus important qu'une malédiction d'agonie qui de toute façon n'a pas le temps d'expirer et est donc une perte de dps.
Il en va de même pour tout autre dot (y compris corruption), le nombre de slots disponible est à zéro, ayant des TFs et surtout un SP présent dans le raid.
En plus d'être un message d'information il tient également lieu d'avertissement.

#showtooltip Asservissement de démon(Rang 3)
/run  m = 4; t = "target"; if GetRaidTargetIndex(t) == nil then SetRaidTarget(t,m) end;
/cast Asservissement de démon(Rang 3)
